// ==UserScript==
// @name         x100
// @namespace    http://tampermonkey.net/
// @version      2024-04-22
// @description  notify that got x100
// @author       nagao
// @match        https://minesweeper.online/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=minesweeper.online
// @grant        none
// ==/UserScript==

{
    'use strict';

    const audioData = 'data:audio/mpeg;base64,';

    const audio = new Audio(audioData);
    audio.loop = true;

    const observerTarget = document.getElementById('page');

    const notify = mutations => {
        mutations.forEach(mutation => {
            if(mutation.target.id === 'R35' && !!R35.g74?.items[30]) {
                audio.play();
            }else if(!audio.paused && !document.getElementById('R35')){
                audio.pause();
                audio.currentTime = 0;
            }
        });
    }

    const observer = new MutationObserver(notify);

    const config = { childList: true, subtree: true };

    observer.observe(observerTarget, config);
}
